const LastSeen = (props) => {

    let l
    debugger

    if (!props.item) {
        l = ""
    } else {
        l = <div className={s.container}>
            {props.item.map(u => <div key={u.id}>
                <div className={s.container_photo}>
                    <img src={u.eat.photoURL} alt="" height="50" width="50"/>
                </div>
                <div className={s.info}>
                    <div className={s.container_name}>{u.eat.name}</div>
                    <div className={s.container_cost}>{u.eat.cost}</div>
                </div>


            </div>)}
        </div>
    }

    return (
        <div className={s.content}>
            {l}
        </div>
    )
}
export default LastSeen
